import BasicProps from "../node_modules/prop-types";
import { Button } from "elements/Element";
export default (props) => {
  if (props.Button) {
    Button.propTypes = {
      tes: BasicProps.array
        ? BasicProps.array
        : () => {
            console.log("salah");
          },
      isPrimary: BasicProps.bool,
    };
  }
};
